  return (
    <div style={{ display: 'flex', flexDirection: 'column', position: 'absolute', left: '48px', top: '48px', gap:'10px'}}>
      <Button icon={<FaKey />} label="Truth & Dare" onClick={() => onSelectCard('card1')} />
      <Button icon={<FaEye />} label="Positions" onClick={() => onSelectCard('card2')} />
